INSERT INTO `equills` VALUES (1,'Enjambre','Alta','','','Frame_2.png','enjambre','','Flow','Layers',NULL,NULL,NULL,NULL,'Una serie variable de partículas persiguen el movimiento del cursor, asemejándose a la sensación de dibujar con un pincel de cerdas largas. Las distintas fuerzas aplicadas en cada partícula generaran trazos intrincados dando lugar a la expresividad.',1),(2,'Espuma','Media','',NULL,'LTSM-eQuills-1200x630-espuma.jpg','espuma','','Flow','Layers',NULL,NULL,NULL,NULL,'Este eQuill explora el concepto de \"orgánico\". Cada trazo se siente vivo y el reto consiste en subordinarlo a una composición mayor.',1),(3,'Portal','Media','',NULL,'LTSM-eQuills-1200x630-portal.jpg','portal','','Flow','Layers',NULL,NULL,NULL,NULL,'¿Qué propiedades puede tener una tinta digital? La punta de este eQuill es un elipse que se deforma dependiendo de la velocidad y dirección del trazo y su \"tinta\" se mantiene en movimiento mientras está fresca y con el paso del tiempo se seca para revelar su apariencia final.',1),(4,'Bulbo','Baja','',NULL,'LTSM-eQuills-esgrafiado.jpg','bulbo','','Flow','Layers',NULL,NULL,NULL,NULL,'Este eQuill nace de la inquietud de imitar los trazos de luz posibles en la fotografía de larga duración.',1),(5,'Esgrafiado','Baja','',NULL,'LTSM-eQuills-bulbo.jpg','esgrafiado','','Flow','Layers',NULL,NULL,NULL,NULL,'Una serie variable de filamentos sensibles a la dirección y fuerza acompañan los trazos abriendo todo un mundo de posibilidades para nuevos ductus y florituras.',1),(6,'Acorde','Baja','',NULL,'LTSM-eQuills-1200x630-acorde.jpg','acorde','','Flow','Layers','class EquillAudio {\r\n    constructor() {\r\n        this.AudioContext = window.AudioContext || window.webkitAudioContext;\r\n        this.audioCtx;\r\n        this.oscillators = new Map();\r\n        this.gainNode;\r\n        this.started = false;\r\n        this.chunks = [];\r\n        this.dest;\r\n        this.isChrome = /Chrome/.test(navigator.userAgent) && /Google Inc/.test(navigator.vendor);\r\n        this.mediaRecorder;\r\n        this.loop;\r\n        if (!this.isChrome) {\r\n            this.init();\r\n        }\r\n    }\r\n\r\n    init() {\r\n        this.started = true;\r\n        this.audioCtx = new AudioContext();\r\n        this.oscillators.set(\'c4\', this.audioCtx.createOscillator());\r\n        this.oscillators.set(\'mapY\', this.audioCtx.createOscillator());\r\n        this.oscillators.set(\'speed\', this.audioCtx.createOscillator());\r\n        this.gainNode = this.audioCtx.createGain();\r\n        this.gainNode.gain.value = 0.0001;\r\n        this.chunks = [];\r\n        this.dest = this.audioCtx.createMediaStreamDestination();\r\n        this.oscillators.forEach((osc) => {\r\n            osc.connect(this.gainNode);\r\n            osc.start();\r\n            osc.detune.value = 100; // value in cents\r\n        });\r\n            \r\n        this.gainNode.connect(this.dest);\r\n        this.gainNode.connect(this.audioCtx.destination);\r\n        this.mediaRecorder = new MediaRecorder(this.dest.stream);\r\n\r\n        this.oscillators.get(\'c4\').frequency.value = 261.63;\r\n        this.mediaRecorder.addEventListener(\'dataavailable\', function (event) {\r\n            this.chunks.push(event.data);\r\n        }.bind(this), false);\r\n        this.mediaRecorder.addEventListener(\'stop\', function (event) {\r\n            // Make blob out of our blobs, and open it.\r\n            var blob = new Blob(this.chunks, {\r\n                \'type\': \'audio/ogg; codecs=opus\'\r\n            });\r\n            document.querySelector(\"audio\").src = URL.createObjectURL(blob);\r\n            document.getElementById(\"controls\").classList.add(\'active\');\r\n\r\n            let url = URL.createObjectURL(blob);\r\n            document.getElementById(\'linkDownload\').href = url;\r\n            document.getElementById(\'linkDownload\').download = \'equill-audio.ogg\';\r\n        }.bind(this), false);\r\n    }\r\n\r\n    playNote(noteDist, noteMapY, amp) {\r\n        this.oscillators.get(\'mapY\').frequency.value = noteMapY;\r\n        this.oscillators.get(\'speed\').frequency.value = noteDist;\r\n    }\r\n\r\n    play() {\r\n        if (!this.started) {\r\n            this.init();\r\n        }\r\n        if (this.isChrome) {\r\n            this.gainNode.gain.value = 0.1;\r\n        } else {\r\n            this.gainNode.gain.setTargetAtTime(1.0, this.audioCtx.currentTime, 0.5);\r\n        }\r\n    }\r\n    stop() {\r\n        this.gainNode.gain.setTargetAtTime(0, this.audioCtx.currentTime, 0.5);\r\n    }\r\n\r\n    startRecording() {\r\n        if (!this.started) {\r\n            this.init();\r\n        }\r\n        this.mediaRecorder.start();\r\n        this.loop = setInterval(() => {\r\n            this.mediaRecorder.requestData();\r\n        }, 100);\r\n    }\r\n    stopRecording() {\r\n        clearInterval(this.loop);\r\n        this.mediaRecorder.stop();\r\n        this.oscillators.forEach((osc) => {\r\n            osc.stop();\r\n        });\r\n    }\r\n\r\n    getFrecuencieOscillator(id) {\r\n        return this.oscillators.get(id).frequency.value;\r\n    }\r\n\r\n\r\n}\r\n// let notes = [64,65,67,69,71,72, 76]; //midi\r\nconst notes = [329.63, 349.23, 392.00, 440.00, 493.88, 523.25, 659.25]; //frecuencies\r\nconst maxFrequency = notes[notes.length - 1];\r\nconst maxSize = 100;\r\nlet playing = false,\r\n    clicked = false,\r\n    finished = false;\r\nlet button, buttonRecord;\r\nlet a = document.getElementById(\'linkDownload\');\r\nlet audioPlayer = document.getElementById(\'audioPlayer\');\r\nlet playBnt = document.getElementById(\'play\');\r\nlet opacity = 1;\r\nlet _osc = new EquillAudio();\r\nlet cnv;\r\nfunction setup() {\r\n    pixelDensity(1);\r\n    cnv = createCanvas(window.innerWidth, window.innerHeight, WEBGL);\r\n    cnv.mousePressed(playOscillator);\r\n    cnv.touchStarted(playOscillator);\r\n\r\n    noStroke();\r\n\r\n    buttonRecord = createButton(\'Record\');\r\n    buttonRecord.addClass(\"record\");\r\n    buttonRecord.mousePressed(clickedRecord);\r\n}\r\n\r\nfunction clickedRecord() {\r\n    if (!clicked) {\r\n        buttonRecord.addClass(\"active\");\r\n        clicked = true;\r\n        _osc.startRecording();\r\n    } else {\r\n        buttonRecord.removeClass(\"active\");\r\n        buttonRecord.addClass(\"finished\");\r\n        buttonRecord.disabled = true;\r\n        finished = true;\r\n        noLoop();\r\n        _osc.stopRecording();\r\n    }\r\n}\r\n\r\nfunction windowResized() {\r\n    resizeCanvas(windowWidth, windowHeight, true);\r\n}\r\n\r\nfunction draw() {\r\n    if (playing) {\r\n        let d = int(dist(mouseX, mouseY, pmouseX, pmouseY));\r\n        if (d > maxSize) {\r\n            d = maxSize;\r\n        }\r\n\r\n        let colorR = Math.floor(map(d, 0, maxSize, 150, 255));\r\n        let colorG = 0;\r\n        let colorB = Math.floor(map(_osc.getFrecuencieOscillator(\'mapY\'), 0, maxFrequency, 255, 0));\r\n        let locX = mouseX - height / 2;\r\n        let locY = mouseY - width / 2;\r\n\r\n        translate(-width / 2, -height / 2);\r\n        push();\r\n        pointLight(colorR, colorG, colorB, 0, 0, 250);\r\n        translate(mouseX, mouseY);\r\n        rotateX(millis() / 1000);\r\n        fill(`rgba(255,255,255,${opacity})`);\r\n        box(d);\r\n        pop();\r\n    }\r\n}\r\n\r\nfunction playOscillator() {\r\n    _osc.play();\r\n    playing = true;\r\n}\r\n\r\nfunction mouseReleased() {\r\n    _osc.stop();\r\n    playing = false;\r\n    window[\"letrism_img\"].value = cnv.canvas.toDataURL(\"image/png\");\r\n    gsap.to(\"#save-letrism, #equill-bottom-actions\", 0.6, {\r\n        ease: Power2.easeOut,\r\n        opacity: 1,\r\n        y: 0,\r\n        display: \"block\"\r\n    });\r\n}\r\n\r\nfunction clearCanvas() {\r\n    clear();\r\n    gsap.to(\"#save-letrism, #equill-bottom-actions\", 0.6, {\r\n        ease: Power2.easeOut,\r\n        opacity: 0,\r\n        y: 15,\r\n        display: \"none\"\r\n    });\r\n}\r\n\r\nfunction keyPressed() {\r\n    if (keyCode == 32) {\r\n        opacity -= .1;\r\n    }\r\n    if (keyCode == 13) {\r\n        opacity = 1;\r\n    }\r\n    if (keyCode == 27) {\r\n        clearCanvas();\r\n    }\r\n}\r\n\r\nfunction mouseDragged(event) {\r\n    if (!finished) {\r\n        if (event.button == 0 && event.clientX < width && event.clientY < height) {\r\n            let d = int(dist(mouseX, mouseY, pmouseX, pmouseY));\r\n\r\n            let keyX = 0;\r\n            if (d < 10) keyX += 1;\r\n            else if (d < 50) keyX += 2;\r\n            else if (d < 100) keyX += 3;\r\n            else if (d < 150) keyX += 4;\r\n            else if (d < 200) keyX += 5;\r\n\r\n            let keyY = floor(map(mouseY, 0, height, 0, notes.length));\r\n            _osc.playNote(notes[keyX], notes[keyY], 0.5);\r\n        }\r\n    }\r\n}\r\n\r\nfunction touchMoved(event) {\r\n    if (!finished) {\r\n        if (event.clientX < width && event.clientY < height) {\r\n            let d = int(dist(mouseX, mouseY, pmouseX, pmouseY));\r\n\r\n            let keyX = 0;\r\n            if (d < 10) keyX += 1;\r\n            else if (d < 50) keyX += 2;\r\n            else if (d < 100) keyX += 3;\r\n            else if (d < 150) keyX += 4;\r\n            else if (d < 200) keyX += 5;\r\n\r\n            let keyY = floor(map(mouseY, 0, height, 0, notes.length));\r\n            _osc.playNote(notes[keyX], notes[keyY], 0.5);\r\n        }\r\n    }\r\n}\r\ndocument.querySelector(\"#clear-btn\").addEventListener(\"click\", (e) => {\r\n    clearCanvas();\r\n})\r\nplayBnt.addEventListener(\"click\", () => {\r\n    audioPlayer.play();\r\n    playBnt.classList.add(\'playing\');\r\n});\r\naudioPlayer.onended = function () {\r\n    playBnt.classList.remove(\'playing\');\r\n}\r\n\r\nwindow[\"download-tif\"].addEventListener(\"click\", (e) => {\r\n    saveCanvas(cnv, \'00-equill-audio-tif\', \'tif\');\r\n});\r\nwindow[\"download-jpg\"].addEventListener(\"click\", (e) => {\r\n    saveCanvas(cnv, \'00-equill-audio-jpg\', \'jpg\');\r\n});','#equill-html #audioPlayer {\r\nopacity:0;\r\nvisibility:hidden;\r\nwidth: 1px;\r\nheight: 1px;\r\npointer-events: none;\r\n}\r\n#equill-html button{background: #000;color:#fff;border:1px solid #fff;transition: all 300ms ease-in-out;padding:10px 25px;}\r\n#equill-html button:hover{cursor:pointer;border:1px solid #980000;}\r\n#equill-html button.record{position:absolute;right:0;top:0;}\r\n#equill-html button.active{border:1px solid #980000;color:#980000;}\r\n#equill-html button.active:before{content: \'\';width: 10px;height: 10px;background: #980000;border-radius: 10px;position: absolute;top: 13px;left: 10px;animation: recording 1s infinite;}\r\n@keyframes recording{from{opacity: 1; }to{opacity: 0.5;}}\r\n#equill-html button.finished{border:1px solid #ccc;color:#ccc;opacity:0.5;}\r\n#equill-html #controls{opacity: 0;position: absolute;bottom: 0;left: calc(50% - 150px);display: grid;grid-template-columns: 1fr 1fr;\r\ngrid-gap: 50px;}\r\n#equill-html #controls.active{opacity: 1;}\r\n#equill-html #play{font-size: 1.5em;}\r\n#equill-html #play.playing{border:1px solid #980000;color:#980000;}\r\n#equill-html #download svg{width:30px;}','<audio id=\"audioPlayer\" controls></audio>\r\n		<div id=\"controls\">\r\n			<button id=\"play\" onclick=\"dataLayer.push({\'event\': \'landing_click\',\'btn_id\':\'play-equill-audio\'});\">&#9658;</button>\r\n			<button id=\"download\" onclick=\"dataLayer.push({\'event\': \'landing_click\',\'btn_id\':\'download-equill-audio\'});\">\r\n			    <a id=\"linkDownload\" href=\"\"><svg aria-hidden=\"true\" focusable=\"false\" data-prefix=\"fas\" data-icon=\"save\" class=\"svg-inline--fa fa-save fa-w-14\" role=\"img\" xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 448 512\"><path fill=\"currentColor\" d=\"M433.941 129.941l-83.882-83.882A48 48 0 0 0 316.118 32H48C21.49 32 0 53.49 0 80v352c0 26.51 21.49 48 48 48h352c26.51 0 48-21.49 48-48V163.882a48 48 0 0 0-14.059-33.941zM224 416c-35.346 0-64-28.6